export default {
    namespaced: true,
    state() {
        return {
            productsList: [],
        }
    },
    mutations: {
    },
    actions: {
        getJson({ commit }, url){
            return fetch(url)
                .then(result => result.json())
                .catch(error => {
                    console.log(error)
                    // this.$refs.error.text = error;
                })
        }
    },
}
